import { Link } from "react-router-dom";

const Header = () => {
  return (
    <div className="header">
      <div className="header-logo">
        <h1>FinTrack</h1>
      </div>
      <div className="nav">
        <ul>
          <li>
            <Link to={"/"}>Home</Link>
          </li>
          <li>
            <Link to={"/"}>Savings</Link>
          </li>
          <li>
            <Link to={"/"}>Financial Literacy</Link>
          </li>
          <li>
            <Link to={"/"}>Profile</Link>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default Header;
